if (response_iserror === false) {
var result = [];
var filtered_result = [];
var response = response_body;
if (response['history']) {
filtered_result = filtered_result.concat(response.history);
for (var i = 0; i < filtered_result.length; i++) {
var obj = {};
if (filtered_result[i]['messagesAdded']) {

obj.event_type = "CREATED";
obj.id = filtered_result[i]['messagesAdded'][0].message.id;

} else if (filtered_result[i]['messagesDeleted']) {

obj.event_type = "DELETED";
obj.id = filtered_result[i]['messagesDeleted'][0].message.id;

} else if (filtered_result[i]['labelsAdded']) {

obj.event_type = "UPDATED";
obj.id = filtered_result[i]['labelsAdded'][0].message.id;

} else if (filtered_result[i]['labelsRemoved']) {

obj.event_type = "UPDATED";
obj.id = filtered_result[i]['labelsRemoved'][0].message.id;

}
if (Object.keys(obj).length !== 0) {
var duplicate = false;
for (var k = 0; k < result.length; k++) {
if (obj.id == result[k].id) {
duplicate = true;
/*If new event_type is DELETED then override ,
else if new event_type is UPDATED and existing is not DELETED then override,
else do not override
*/
result[k].event_type = obj.event_type == "DELETED" ? obj.event_type : obj.event_type == "UPDATED" && result[k].event_type != "DELETED" ? obj.event_type : result[k].event_type
}
}
if (!duplicate)
result.push(obj);
}
}
}
if (response.nextPageToken === undefined) {
configuration['users.syncToken'] = response.historyId;
}
done({
'response_body': result,
'configuration': configuration
});
} else {
done({});
}

